class Login extends Component {
  render() {
    return(
      <div>
        <h1> Log In</h1>
        < LoginForm />
      </div>
    )
  }
}

class LoginForm extends Component {
  render() {
    return (
      <h2> Login Form Coming Soon</h2>
    )
  }
}

export default Login;
